import axios from 'axios';
import React, { useState, useEffect } from 'react';
import {MDBTable, MDBTableHead, MDBTableBody, MDBRow, MDBCol, MDBContainer} from "mdb-react-ui-kit";

function App() {
  const [data, setData] = useState([]);


  useEffect(() => {
    loadUserData();
  }, []);

  const loadUserData = async () => {
    return await axios
      .get("http://localhost:5000/users")
      .then((response) => setData(response.data))
      .catch((err) => console.log(err));
  }

  console.log("Data"+data);
  return (
   <MDBContainer>
    <div style={{marginTop:"100px"}}>
      <h2>search, filter, sort and pagination using JSON fake rest API</h2>
      <MDBRow>
        <MDBCol size="12px">Name</MDBCol>
        <MDBCol>Email</MDBCol>
        <MDBCol>Phone</MDBCol>
        <MDBCol>Address</MDBCol>
        <MDBCol>ID</MDBCol>
        <MDBCol>Status</MDBCol>
      </MDBRow>
    </div>
   </MDBContainer>
  );
}

export default App;
